In het jaar 2154 bestaan er twee klassen: de zeer rijke mensen die op een ruimtestation met de naam Elysium wonen, 
en de rest, die op een overbevolkte Aarde moeten leven. Secretaris Rhodes (Jodie Foster) is een hardvochtige regeringsleider 
die er alles aan doet om de luxe levensstijl van de bewoners van Elysium te beschermen. Nieuwe anti-immigratiewetten zijn 
dan ook het gevolg. Dat weerhoudt de Aardbewoners er echter niet van te proberen Elysium te bereiken. 
